import React, { useEffect, useState } from "react";

interface ProfileData {
    name:string,
    phone:string
}

const Profile: React.FC<ProfileData> = ({ name,phone }: ProfileData) => {
    return (
        <div>
            <div>{name}</div>
            <div>{phone}</div>
        </div>
    )
}

export default Profile;
